import React, { Component } from "react";
// import { Table, Popconfirm, Input, Button, Space } from "antd";
import { Form, Input, Button, Checkbox } from "antd";
// import { EditTwoTone, DeleteOutlined, SearchOutlined } from "@ant-design/icons";
// import I18n from "i18n-js";

const layout = {
  labelCol: { span: 10 },
  wrapperCol: { span: 14 },
};

const RegistrationForm = (props) => {
  const { customerData } = props;
  const [form] = Form.useForm();
  const onFinish = (values) => {
    console.log("Success:", values);
  };

  const onFinishFailed = (errorInfo) => {
    console.log("Failed:", errorInfo);
  };

  const onReset = () => {
    form.resetFields();
  };

  return (
    <div
      style={{
        display: "block",
        width: 400,
        marginLeft: 250,
      }}
    >
      <Form
        {...layout}
        form={form}
        name="basic"
        //   labelCol={{ span: 8 }}
        //   wrapperCol={{ span: 16 }}
        initialValues={{ remember: true }}
        onFinish={onFinish}
        onFinishFailed={onFinishFailed}
        autoComplete="off"
      >
        <Form.Item
          label="Username"
          name="username"
          rules={[{ required: true, message: "Please input your username!" }]}
        >
          <Input />
        </Form.Item>

        <Form.Item
          label="Password"
          name="password"
          rules={[{ required: true, message: "Please input your password!" }]}
        >
          <Input.Password />
        </Form.Item>

        <Form.Item
          label="Confirm Password"
          name="confirm_password"
          rules={[
            { required: true, message: "Please input your confirm_password!" },
          ]}
        >
          <Input.Password />
        </Form.Item>

        {/* <Form.Item name="remember" valuePropName="checked" wrapperCol={{ offset: 8, span: 16 }}>
        <Checkbox>Remember me</Checkbox>
      </Form.Item> */}

        <Form.Item wrapperCol={{ ...layout.wrapperCol, offset: 8 }}>
          <Button type="primary" style={{ marginLeft: 100 }} htmlType="submit">
            Register
          </Button>
          <Button
            style={{
              // marginLeft: 30,
              marginLeft: 20,
              background: "#8c8c8c",
              borderColor: "#8c8c8c",
            }}
            type="primary"
            htmlType="button"
            onClick={onReset}
          >
            Clear
          </Button>
        </Form.Item>
      </Form>
    </div>
  );
};

export default RegistrationForm;
